import React from 'react'

const Category = ({ categories }) => {
    return (<>
        {categories.map(item => {
            if (item.avatarUrl && item.avatarUrl.url){
                return ( <>
                    <div>{item.displayName}</div>
                    <div>{item.avatarUrl.url}</div>
                </>)
            }

        })}
    </>
    )
}

export default Category
